import React, { useEffect } from 'react';
import { useDispatch, useSelector } from 'react-redux';

import { setMediaAction } from '../../store/actions/mediaAction';

import CollectionCardsMedia from '../../components/collectionCards/collectionCardsMedia';

const Movies = () => {
  const dispatch = useDispatch();
  const data = useSelector((state) => state.mediaStore.media);
  
  useEffect(() => {
    if (!data.length) {
      setMediaAction({name: ''}, 'search')(dispatch);
    }
  });

  return <React.Fragment>
    <CollectionCardsMedia data={data} />

    <div className="ratingBox">
              <form onClick={reting} name="formReting" className={'rating'}>
                <input
                  type="radio"
                  id="star-5"
                  name="rating"
                  defaultChecked={star === 5}
                  value="5"
                  disabled={isDisabled}
                />
                <label className={classNames} htmlFor={'star-5'}></label>
                <input
                  type="radio"
                  id="star-4"
                  name="rating"
                  defaultChecked={star === 4}
                  value="4"
                  disabled={isDisabled}
                />
                <label className={classNames} htmlFor={'star-4'}></label>
                <input
                  type="radio"
                  id="star-3"
                  name="rating"
                  defaultChecked={star === 3}
                  value="3"
                  disabled={isDisabled}
                />
                <label className={classNames} htmlFor={'star-3'}></label>
                <input
                  type="radio"
                  id="star-2"
                  name="rating"
                  defaultChecked={star === 2}
                  value="2"
                  disabled={isDisabled}
                />
                <label className={classNames} htmlFor={'star-2'}></label>
                <input
                  type="radio"
                  id="star-1"
                  name="rating"
                  defaultChecked={star === 1}
                  value="1"
                  disabled={isDisabled}
                />
                <label className={classNames} htmlFor={'star-1'}></label>
              </form>
            </div>
    </React.Fragment>;
};

export default Movies;
